import './App.css';
import Header from './components/Header'
import TitleSection from './components/TitleSection';
import Form from './components/Form';

function App() {
  return (
    <div className="App">
      <Header></Header>
      <TitleSection></TitleSection>
      <Form></Form>
    </div>
  );
}

export default App;
